import { inject, observer } from 'mobx-react'
import React, { Component } from 'react'
import { Form, Input, Button, Checkbox, Table } from 'antd';
import GlobalForm from 'components/GlobalForm';


@inject('SpareStore')
@inject('HomeStore')
@observer
class StandingPage extends React.Component {
  render() {
    const { columns } = this.props.SpareStore;
    const { data } = this.props.SpareStore;
    const { model } = this.props.HomeStore;
    console.log(model);
    if (model == 'look') {
      return <Table columns={columns} dataSource={data}></Table>;
    } else {
      return <GlobalForm/>

    }


  }
}

export default StandingPage;
